import 'package:carousel_slider/carousel_slider.dart';
import 'package:flutter/cupertino.dart';
import 'package:flutter/material.dart';

void main(){
  runApp(MaterialApp(
    debugShowCheckedModeBanner: false,
    home: MyCarousel(),
  ));
}

class MyCarousel extends StatelessWidget{
  List<String> images=["data:image/jpeg;base64,",
  "data:image/jpeg;base64,",
  "data:image/jpeg;base64,",
  "https://images.ctfassets.net/hrltx12pl8hq/a2hkMAaruSQ8haQZ4rBL9/8ff4a6f289b9ca3f4e6474f29793a74a/nature-image-for-website.jpg?fit=fill&w=480&h=320"];
  @override
  Widget build(BuildContext context) {
    return Scaffold(
      appBar: AppBar(
        title: Text("Carousel Slider"),
      ),
      body:Container(
        margin: EdgeInsets.all(10),
        child: CarouselSlider.builder(
            itemCount: images.length,

            itemBuilder: (context,i,id){
              return GestureDetector(//for performing event in flutter
                child: Container(
                  decoration: BoxDecoration(
                    borderRadius: BorderRadius.circular(40),
                    border: Border.all(
                      color: Colors.pink
                    )
                  ),
                  child: ClipRRect(
                    child: Image.network(images[i],fit: BoxFit.cover,),
                    borderRadius: BorderRadius.circular(40),
                  )

                ),
                onTap: (){
                  print("Hai");
                },
              );
            },

            options: CarouselOptions(
              height: 300,
              autoPlay: true,
              autoPlayInterval: Duration(seconds: 3),
              aspectRatio: 5,
              enlargeCenterPage: true//for making center image large
            ))
      ) ,
    );
  }
}